package Hello;

public class logicaloperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=12;
		int b=15;
		int x=5;
		int y=2;
		boolean result= a>b && x>y;
		boolean result1= a>b || x>y;
		System.out.println(result);
		System.out.println(result1);

	}

}
